    <script type="text/javascript" inline>
      var banner,
        mainTl = gsap.timeline();
      function announceLoad(e) {
        for (
          var a = e.currentTarget || e.srcElement,
            o = imageLoadTracker.length,
            n = 0;
          n < o;
          n++
        )
          if (a.id == imageLoadTracker[n]) {
            imageLoadTracker.splice(n, 1);
            break;
          }
        imageLoadTracker.length <= 0 && init();
      }
      function init() {
        var e = 0.25;
        (document.getElementById("cover").style.display = "none"),
          (document.getElementById("banner").style.display = "block"),
          (banner = document.getElementById("banner")).addEventListener(
            "mouseenter",
            onMouseEnter
          ),
          banner.addEventListener("mouseleave", onMouseLeave),
          mainTl

            .to(txt1a, 0.5, { x: "0", ease: "power1.inOut", overwrite: 0 }, "<")
            .to(
              cta,
              0.5,
              { x: "0", ease: "power1.inOut", overwrite: 0 },
              "<+=0.1"
            )
            .from(frame2Cont, { duration: 0.9, width: 0, ease: "none" }, 0.87)
            .to(".ballCont", { duration: 1, x: "+=360", ease: "none" }, 0.85)
            .to(
              ball,
              { duration: 1.25, rotation: "700", ease: "none" },
              "<+0.05"
            )
            .call(onMouseEnter, null, ">0.5")
            .call(onMouseLeave, null, ">1");
      }
      function onMouseEnter() {
        gsap.to(ctaArrow, 0.2, { x: "5", ease: "power1.inOut" });
      }
      function onMouseLeave() {
        gsap.to(ctaArrow, 0.2, { x: "0", ease: "power1.inOut" });
      }
    </script>
